import './Header.scss'; 
import mymood from '../../assets/mymood.png'; 


const Header = () => {
  return (
    <div>
        <img src={mymood} alt="MyMood" className='mymood'/>
        <h1>Welcome to MyMmmood</h1>
        <h2>A place where you can take a step bacl</h2>
    </div>
  );
}

export default Header;
